Parses.Sparql:
#MANUAL SPARQL
PREFIX ns: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?x
WHERE {
{
  SELECT DISTINCT ?f1
  WHERE {
    ns:m.0f2y0 ns:film.film_character.portrayed_in_films ?y .  # Darth Vader
    ?y ns:film.performance.film ?f1 .
    ?f1 ns:film.film.initial_release_date ?d .
  }
  ORDER BY ?d
  LIMIT 1
}
  ns:m.0f2y0 ns:film.film_character.portrayed_in_films ?y .  # Darth Vader
  ?y ns:film.performance.actor ?x ; 
     ns:film.performance.film ?f .
  FILTER (?f1 = ?f)
}

#MANUAL SPARQL
PREFIX ns: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?x
WHERE {
	{ 
	  # Film
	  ns:m.0534r8 ns:film.film_character.portrayed_in_films ?y .
	  ?y ns:film.performance.actor ?x .
	  ?y ns:film.performance.special_performance_type ns:m.02nsjvf . #voice
	}
	UNION
	{
	  # TV
	  ns:m.0534r8 ns:tv.tv_character.appeared_in_tv_program ?y .
	  ?y ns:tv.regular_tv_appearance.actor ?x .
	}
}
